import Navbar from './components/PropsNavbar';
import List from './components/List';
import ANavbar from './components/BootStrapNavbar';
import HooksStates from './components/HooksStates';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom';

function App() {

  return (
    //class for html
    <>
      <Router>

        <ANavbar />
        <div className="App">
          <Switch>
            <Route path='/list'>
              <List></List>
            </Route>

            <Route path='/'>
              <Navbar headingText="First Heading" name="Akshat" />
              <Navbar />

              <HooksStates heading="This is states" />

            </Route>


          </Switch>
        </div>
      </Router>
    </>
  );
}

export default App;
